  cadastroSeries(101391,'Índice de Preços ao Produtor (IPP)','Índice de Preços ao Produtor (IPP)','O Índice de Preços ao Produtor - IPP, cujo âmbito são as indústrias extrativas e de transformação, tem como principal objetivo mensurar a mudança média dos preços de venda recebidos pelos produtores domésticos de bens e serviços, bem como sua evolução ao longo do tempo, sinalizando as tendências inflacionárias de curto prazo no País.O IPP investiga, em pouco mais de 2.100 empresas, os preços recebidos pelo produtor, isentos de impostos, tarifas e fretes e definidos segundo as práticas comerciais mais usuais. Os produtos coletados são especificados em detalhes (aspectos físicos e de transação), garantindo, dessa forma, que sejam comparados produtos homogêneos ao longo do tempo. Com isso, coletam-se cerca de 6 000 preços mensalmente.','%','IBGE','https://servicodados.ibge.gov.br/api/v3/agregados/6723/periodos/all/variaveis/1396?localidades=N1[1]&classificacao=844[47180]',1,'mensal','Variação mensal','Brasil','Brasil','101 Abate e fabricação de produtos de carne'),
